<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>marziale</title>
    <link rel="icon" type="image/svg+xml" href="assets/brand/favicon.svg">
    <link href="https://fonts.cdnfonts.com/css/w95fa" rel="stylesheet">
    <style>
        * { box-sizing: border-box; }
        html, body {
            font-family: "W95FA", "MS Sans Serif", "Microsoft Sans Serif", Geneva, sans-serif;
        }
        body {
            margin: 0;
            height: 100vh;
            overflow: hidden;
            background: #2563eb;
            color: #fff;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 0;
        }
        .header {
            width: 100%;
            display: flex;
            justify-content: center;
            padding: clamp(1.5rem, 5vw, 3rem) clamp(0.75rem, 4vw, 2rem);
        }
        .header svg {
            display: block;
            width: 100%;
            max-width: 85vw;
            height: auto;
            object-fit: contain;
        }
        .header rect,
        .stage rect {
            opacity: 0;
            fill: currentColor;
        }
        .stage {
            flex: 1;
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: clamp(2.5rem, 6vw, 5rem);
            justify-items: center;
            align-items: start;
            width: 100%;
            max-width: 3200px;
            padding: clamp(2rem, 8vw, 6rem) clamp(0.75rem, 4vw, 2rem) clamp(1rem, 3vw, 2rem);
            margin: -10vh auto 0 auto;
        }
        .stage .figure {
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .stage .figure:nth-child(1) {
            margin-top: calc(clamp(5rem, 14vw, 10rem) + 20vh);
            position: relative;
        }
        .stage .figure:nth-child(2) {
            margin-top: 0;
            position: relative;
        }
        .stage .figure svg {
            display: block;
            width: 100%;
            max-width: min(50vw, 1600px);
            height: auto;
            object-fit: contain;
        }
        @media (max-width: 700px) {
            body {
                padding-top: 15vh;
            }
            .header {
                padding: clamp(0.75rem, 2vw, 1.5rem) clamp(0.5rem, 2vw, 1rem);
            }
            .stage {
                flex: 1;
                gap: clamp(0.25rem, 1vw, 0.75rem);
                padding: 0 clamp(0.25rem, 1vw, 0.5rem) clamp(0.5rem, 2vw, 1rem);
                align-items: start;
                margin-top: 0;
            }
            .stage .figure svg {
                max-width: 60vw;
            }
            .stage .figure:nth-child(1) {
                align-self: center;
                margin-top: clamp(4rem, 12vw, 8rem);
            }
            .stage .figure:nth-child(2) {
                align-self: start;
                margin-top: clamp(1rem, 4vw, 2rem);
            }
        }

        /* Desktop Icons (Mail, About, etc.) */
        .desktop-icon {
            position: absolute;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 0.25rem;
            background: transparent;
            border: none;
            padding: 0.5rem;
            cursor: grab;
            user-select: none;
            z-index: 100;
            width: clamp(3rem, 8vw, 4.5rem);
        }
        .desktop-icon:active {
            cursor: grabbing;
        }
        .desktop-icon img,
        .desktop-icon svg {
            display: block;
            width: 100%;
            height: clamp(2.5rem, 6vw, 3.5rem);
            object-fit: contain;
        }
        #aboutBtn img,
        #aboutBtn svg {
            height: clamp(2rem, 4.8vw, 2.8rem);
        }
        .desktop-icon .icon-caption {
            font-family: "W95FA", "MS Sans Serif", "Microsoft Sans Serif", Geneva, sans-serif;
            font-size: clamp(0.65rem, 1.5vw, 0.8rem);
            font-weight: 400;
            color: #fff;
            text-shadow: 0 1px 2px rgba(0,0,0,0.3);
        }

        /* Mail button */
        .mail-btn {
            position: absolute;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 0.25rem;
            background: transparent;
            border: none;
            padding: 0.5rem;
            cursor: grab;
            user-select: none;
            z-index: 100;
            width: clamp(3rem, 8vw, 4.5rem);
        }
        .mail-btn:active {
            cursor: grabbing;
        }
        .mail-btn img {
            display: block;
            width: 100%;
            height: clamp(2.5rem, 6vw, 3.5rem);
            object-fit: contain;
        }
        .mail-btn .mail-caption {
            font-family: "W95FA", "MS Sans Serif", "Microsoft Sans Serif", Geneva, sans-serif;
            font-size: clamp(0.65rem, 1.5vw, 0.8rem);
            font-weight: 400;
            color: #fff;
            text-shadow: 0 1px 2px rgba(0,0,0,0.3);
        }

        /* Retro Windows 95/97 mail window */
        .mail-window {
            position: fixed;
            background: #c0c0c0;
            color: #000;
            border: 2px solid;
            border-color: #dfdfdf #000 #000 #dfdfdf;
            box-shadow: 2px 2px 0 #404040;
            z-index: 200;
            min-width: 320px;
            max-width: 90vw;
            font-family: inherit;
            display: none;
            font-size: 11px;
        }
        .mail-window.open {
            display: block;
        }
        .mail-window-header {
            background: linear-gradient(90deg, #000080 0%, #1084d0 100%);
            color: #fff;
            padding: 3px 6px 4px 6px;
            font-size: 11px;
            cursor: grab;
            display: flex;
            justify-content: space-between;
            align-items: center;
            border-bottom: 1px solid #000;
        }
        .mail-window-header:active {
            cursor: grabbing;
        }
        .mail-window-close {
            background: #c0c0c0;
            color: #000;
            border: 1px solid;
            border-color: #fff #404040 #404040 #fff;
            font-size: 11px;
            cursor: pointer;
            line-height: 1;
            padding: 0 6px;
            font-family: inherit;
        }
        .mail-window-close:hover {
            background: #d4d0c8;
        }
        .mail-window-close:active {
            border-color: #404040 #fff #fff #404040;
        }
        .mail-window-body {
            padding: 12px;
            background: #fff;
            border: 1px solid #808080;
            margin: 2px;
        }
        .mail-row {
            display: flex;
            align-items: center;
            gap: 8px;
            margin-bottom: 8px;
        }
        .mail-row label {
            font-weight: 400;
            font-size: 11px;
            min-width: 52px;
        }
        .mail-row input {
            flex: 1;
            padding: 2px 4px;
            border: 2px solid;
            border-color: #404040 #fff #fff #404040;
            font-family: inherit;
            font-size: 11px;
            background: #fff;
        }
        .mail-row input:read-only {
            background: #d4d0c8;
            color: #000;
        }
        .mail-row input:focus {
            outline: 1px dotted #000;
        }
        .mail-send-btn {
            background: #c0c0c0;
            color: #000;
            border: 2px solid;
            border-color: #fff #404040 #404040 #fff;
            padding: 2px 12px;
            font-family: inherit;
            font-size: 11px;
            cursor: pointer;
            flex-shrink: 0;
        }
        .mail-send-btn:hover {
            background: #d4d0c8;
        }
        .mail-send-btn:active {
            border-color: #404040 #fff #fff #404040;
        }
        .mail-body-row {
            margin-top: 10px;
        }
        .mail-body-row textarea {
            width: 100%;
            min-height: 100px;
            padding: 4px;
            border: 2px solid;
            border-color: #404040 #fff #fff #404040;
            font-family: inherit;
            font-size: 11px;
            resize: vertical;
            background: #fff;
        }
        .mail-body-row textarea:focus {
            outline: 1px dotted #000;
        }
        .mail-status {
            margin-top: 6px;
            font-size: 11px;
            min-height: 1.2em;
        }
        .mail-status.success {
            color: #000080;
        }
        .mail-status.error {
            color: #800000;
        }

        /* Desktop: larger mail window text (~2x) */
        @media (min-width: 701px) {
            .mail-window,
            .mail-window-header,
            .mail-window-close,
            .mail-row label,
            .mail-row input,
            .mail-send-btn,
            .mail-body-row textarea,
            .mail-status {
                font-size: 22px;
            }
            .mail-window-body {
                padding: 20px;
            }
            .mail-row {
                gap: 12px;
                margin-bottom: 12px;
            }
            .mail-row label {
                min-width: 90px;
            }
            .mail-row input {
                padding: 4px 8px;
            }
            .mail-send-btn {
                padding: 4px 20px;
            }
            .mail-body-row {
                margin-top: 16px;
            }
            .mail-body-row textarea {
                min-height: 160px;
                padding: 8px;
            }
            .mail-status {
                margin-top: 10px;
            }
        }

        /* Prevent iOS zoom on input focus by using 16px font on mobile */
        @media (max-width: 700px) {
            .mail-row input,
            .mail-body-row textarea {
                font-size: 16px;
            }
        }

        /* About Window (Notepad style) */
        .about-window {
            position: fixed;
            background: #c0c0c0;
            color: #000;
            border: 2px solid;
            border-color: #dfdfdf #000 #000 #dfdfdf;
            box-shadow: 2px 2px 0 #404040;
            z-index: 200;
            width: 420px;
            max-width: 90vw;
            font-family: inherit;
            display: none;
            font-size: 11px;
        }
        .about-window.open {
            display: block;
        }
        .about-window-header {
            background: linear-gradient(90deg, #000080 0%, #1084d0 100%);
            color: #fff;
            padding: 3px 6px 4px 6px;
            font-size: 11px;
            cursor: grab;
            display: flex;
            justify-content: space-between;
            align-items: center;
            border-bottom: 1px solid #000;
        }
        .about-window-header:active {
            cursor: grabbing;
        }
        .about-window-close {
            background: #c0c0c0;
            color: #000;
            border: 1px solid;
            border-color: #fff #404040 #404040 #fff;
            font-size: 11px;
            cursor: pointer;
            line-height: 1;
            padding: 0 6px;
            font-family: inherit;
        }
        .about-window-close:hover {
            background: #d4d0c8;
        }
        .about-window-close:active {
            border-color: #404040 #fff #fff #404040;
        }
        .about-window-body {
            background: #fff;
            border: 2px solid;
            border-color: #404040 #fff #fff #404040;
            margin: 2px;
            padding: 8px;
            height: 300px;
            max-height: 50vh;
            overflow-y: auto;
            font-family: Consolas, Monaco, "Courier New", monospace;
            font-size: 6.6px;
            line-height: 1;
            white-space: pre;
        }

        @media (min-width: 701px) {
            .about-window,
            .about-window-header,
            .about-window-close {
                font-size: 18px;
            }
            .about-window {
                width: 600px;
            }
            .about-window-body {
                font-size: 9.6px;
                height: 400px;
                padding: 16px;
            }
        }
    </style>
</head>

    <script>
(function () {
    const DURATION_MS = 5000;
    const figAngel = document.getElementById('figAngel');
    const figManOnBoat = document.getElementById('figManOnBoat');
    const figMartech = document.getElementById('figMartech');

    function shuffle(arr) {
        var a = arr.slice();
        for (var i = a.length - 1; i > 0; i--) {
            var j = Math.floor(Math.random() * (i + 1));
            var t = a[i]; a[i] = a[j]; a[j] = t;
        }
        return a;
    }

    var allRects = [];
    var revealTimes = [];
    var animationId = null;

    function hideAll() {
        allRects.forEach(function (r) { r.style.opacity = '0'; });
    }

    function runReveal() {
        if (animationId != null) cancelAnimationFrame(animationId);
        hideAll();
        for (var i = 0; i < allRects.length; i++) revealTimes[i] = (DURATION_MS * i) / allRects.length;
        var start = performance.now();
        function tick(now) {
            var elapsed = now - start;
            for (var i = 0; i < allRects.length; i++) {
                if (revealTimes[i] <= elapsed) allRects[i].style.opacity = '1';
            }
            if (elapsed < DURATION_MS) animationId = requestAnimationFrame(tick);
            else animationId = null;
        }
        animationId = requestAnimationFrame(tick);
    }

    function start() {
        var martechRects = Array.from(figMartech.querySelectorAll('rect'));
        var angelRects = Array.from(figAngel.querySelectorAll('rect'));
        var manOnBoatRects = Array.from(figManOnBoat.querySelectorAll('rect'));
        if (martechRects.length === 0 && angelRects.length === 0 && manOnBoatRects.length === 0) return;
        allRects = shuffle(martechRects.concat(angelRects).concat(manOnBoatRects));
        revealTimes = [];
        hideAll();
        setTimeout(runReveal, 150);
    }

    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', start);
    } else {
        start();
    }
})();

// Mail Button & Window functionality
(function() {
    const mailBtn = document.getElementById('mailBtn');
    const mailWindow = document.getElementById('mailWindow');
    const mailWindowHeader = document.getElementById('mailWindowHeader');
    const mailWindowClose = document.getElementById('mailWindowClose');
    const mailSendBtn = document.getElementById('mailSendBtn');
    const mailFrom = document.getElementById('mailFrom');
    const mailSubject = document.getElementById('mailSubject');
    const mailBody = document.getElementById('mailBody');
    const mailStatus = document.getElementById('mailStatus');
    const figAngel = document.getElementById('figAngel');
    const figManOnBoatForMail = document.getElementById('figManOnBoat');

    // About button & window
    const aboutBtn = document.getElementById('aboutBtn');
    const aboutWindow = document.getElementById('aboutWindow');
    const aboutWindowHeader = document.getElementById('aboutWindowHeader');
    const aboutWindowClose = document.getElementById('aboutWindowClose');
    const loginBtn = document.getElementById('loginBtn');

    // Position the mail button near the man on boat's hand
    // Man on boat SVG viewBox is 0 0 1200 800
    function positionMailBtn() {
        const svg = figManOnBoatForMail.querySelector('svg[viewBox="0 0 1200 800"]');
        if (!svg) return;
        const rect = svg.getBoundingClientRect();
        const figRect = figManOnBoatForMail.getBoundingClientRect();
        
        // Position relative to man on boat's hand area
        // Adjust these SVG coords (x=450, y=350) to match the hand position
        const targetX = rect.left + (450 / 1200) * rect.width;
        const targetY = rect.top + (350 / 800) * rect.height;
        
        let btnX = targetX - figRect.left - (mailBtn.offsetWidth / 2) + 30;
        let btnY = targetY - figRect.top - (mailBtn.offsetHeight / 2) - 100;
        
        if (window.innerWidth <= 700) {
            btnX += 0;
            btnY += 0;
        }
        
        mailBtn.style.left = btnX + 'px';
        mailBtn.style.top = btnY + 'px';
    }

    // Position the about button (swapped with Contact  About is near angel's arm)
    function positionAboutBtn() {
        const svg = figAngel.querySelector('svg[viewBox="0 0 1200 800"]');
        if (!svg) return;
        const rect = svg.getBoundingClientRect();
        const figRect = figAngel.getBoundingClientRect();
        
        const targetX = rect.left + (780 / 1200) * rect.width;
        const targetY = rect.top + (210 / 800) * rect.height;
        
        let btnX = targetX - figRect.left - (aboutBtn.offsetWidth / 2) - 175;
        let btnY = targetY - figRect.top - (aboutBtn.offsetHeight / 2) - 50;
        
        if (window.innerWidth <= 700) {
            btnX += 40;
            btnY += 20;
        }
        
        aboutBtn.style.left = btnX + 'px';
        aboutBtn.style.top = btnY + 'px';
    }

    // Position the Login button at 75% right, 75% down
    function positionLoginBtn() {
        const figRect = figAngel.getBoundingClientRect();
        const btnX = (window.innerWidth * 0.75) - (loginBtn.offsetWidth / 2) - figRect.left;
        const btnY = (window.innerHeight * 0.75) - (loginBtn.offsetHeight / 2) - figRect.top;
        loginBtn.style.left = btnX + 'px';
        loginBtn.style.top = btnY + 'px';
    }

    // Make an element draggable (with movement threshold so taps work on mobile)
    const DRAG_THRESHOLD_PX = 10;
    let lastOpenedFromTap = 0;
    let lastDragEndedAt = 0;

    function makeDraggable(el, handle, onTap) {
        handle = handle || el;
        let isActive = false;
        let dragStarted = false;
        let startX, startY, origX, origY;

        function onStart(e) {
            if (e.target.tagName === 'BUTTON' && e.target !== handle && e.target !== el) return;
            isActive = true;
            const touch = e.touches ? e.touches[0] : e;
            startX = touch.clientX;
            startY = touch.clientY;
            const rect = el.getBoundingClientRect();
            origX = rect.left;
            origY = rect.top;
            dragStarted = false;
            e.preventDefault(); // Prevent native image drag on all events
        }

        function onMove(e) {
            if (!isActive) return;
            const touch = e.touches ? e.touches[0] : e;
            const dx = touch.clientX - startX;
            const dy = touch.clientY - startY;
            if (!dragStarted && (Math.abs(dx) > DRAG_THRESHOLD_PX || Math.abs(dy) > DRAG_THRESHOLD_PX)) {
                dragStarted = true;
                el.style.position = 'fixed';
                el.style.left = origX + 'px';
                el.style.top = origY + 'px';
                el.style.margin = '0';
            }
            if (dragStarted) {
                el.style.left = (origX + dx) + 'px';
                el.style.top = (origY + dy) + 'px';
                if (e.touches) e.preventDefault();
            }
        }

        function onEnd(e) {
            if (!isActive) return;
            if (e.type === 'touchend' && onTap && !dragStarted) {
                onTap();
                lastOpenedFromTap = Date.now();
            }
            if (dragStarted) {
                lastDragEndedAt = Date.now();
            }
            isActive = false;
            dragStarted = false;
        }

        handle.addEventListener('mousedown', onStart);
        handle.addEventListener('touchstart', onStart, { passive: false });
        document.addEventListener('mousemove', onMove);
        document.addEventListener('touchmove', onMove, { passive: false });
        document.addEventListener('mouseup', onEnd);
        document.addEventListener('touchend', onEnd);
    }

    // Open mail window
    function openMailWindow() {
        const btnRect = mailBtn.getBoundingClientRect();
        mailWindow.style.left = Math.max(10, btnRect.left - 100) + 'px';
        mailWindow.style.top = Math.max(10, btnRect.bottom + 10) + 'px';
        mailWindow.classList.add('open');
    }

    // Close mail window
    function closeMailWindow() {
        mailWindow.classList.remove('open');
        mailStatus.textContent = '';
        mailStatus.className = 'mail-status';
    }

    // Open about window
    function openAboutWindow() {
        aboutWindow.classList.add('open');
        const w = aboutWindow.offsetWidth;
        const h = aboutWindow.offsetHeight;
        aboutWindow.style.left = Math.max(10, (window.innerWidth - w) / 2) + 'px';
        aboutWindow.style.top = Math.max(10, (window.innerHeight - h) / 2) + 'px';
    }

    // Close about window
    function closeAboutWindow() {
        aboutWindow.classList.remove('open');
    }

    // Send email via Web3Forms
    const WEB3FORMS_ACCESS_KEY = '2de8b553-8cd7-4320-bfbf-8db3606db563';

    async function sendEmail() {
        const from = mailFrom.value.trim();
        const subject = mailSubject.value.trim();
        const body = mailBody.value.trim();

        // Validate all fields
        const emailValid = /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(from);
        if (!emailValid || !subject || !body) {
            // Trigger validation display
            mailFrom.dispatchEvent(new Event('input'));
            return;
        }

        // Disable button while sending
        mailSendBtn.disabled = true;
        mailSendBtn.textContent = 'Sending...';
        mailStatus.textContent = '';
        mailStatus.className = 'mail-status';

        try {
            const response = await fetch('https://api.web3forms.com/submit', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                },
                body: JSON.stringify({
                    access_key: WEB3FORMS_ACCESS_KEY,
                    subject: subject,
                    from_name: 'Marziale Website',
                    message: 'Reply to ' + from + '\n\n' + body
                })
            });

            const result = await response.json();

            if (result.success) {
                mailStatus.textContent = 'Sent!';
                mailStatus.className = 'mail-status success';
                // Clear form
                mailFrom.value = '';
                mailSubject.value = '';
                mailBody.value = '';
            } else {
                mailStatus.textContent = 'Failed to send. Please try again.';
                mailStatus.className = 'mail-status error';
            }
        } catch (error) {
            mailStatus.textContent = 'Failed to send. Please try again.';
            mailStatus.className = 'mail-status error';
        }

        // Re-enable button
        mailSendBtn.disabled = false;
        mailSendBtn.textContent = 'Send';
    }

    // Initialize
    function init() {
        positionMailBtn();
        makeDraggable(mailBtn, null, openMailWindow);
        makeDraggable(mailWindow, mailWindowHeader);

        mailBtn.addEventListener('click', function(e) {
            if (Date.now() - lastOpenedFromTap < 400) return; // Already opened from tap on mobile
            if (Date.now() - lastDragEndedAt < 100) return; // Ignore click right after drag
            openMailWindow();
        });

        mailWindowClose.addEventListener('click', closeMailWindow);
        mailSendBtn.addEventListener('click', sendEmail);

        // About button & window
        positionAboutBtn();
        makeDraggable(aboutBtn, null, openAboutWindow);
        makeDraggable(aboutWindow, aboutWindowHeader);

        aboutBtn.addEventListener('click', function(e) {
            if (Date.now() - lastOpenedFromTap < 400) return;
            if (Date.now() - lastDragEndedAt < 100) return; // Ignore click right after drag
            openAboutWindow();
        });

        aboutWindowClose.addEventListener('click', closeAboutWindow);

        // Login button
        positionLoginBtn();
        makeDraggable(loginBtn, null, function() {
            window.location.href = 'https://marziale.tech';
        });
        loginBtn.addEventListener('click', function(e) {
            if (Date.now() - lastOpenedFromTap < 400) return;
            if (Date.now() - lastDragEndedAt < 100) return;
            window.location.href = 'https://marziale.tech';
        });

        // Real-time validation
        function validateForm() {
            const errors = [];
            const from = mailFrom.value.trim();
            const subject = mailSubject.value.trim();
            const body = mailBody.value.trim();

            if (!from) {
                errors.push('From email is required');
            } else if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(from)) {
                errors.push('Email is invalid');
            }
            if (!subject) {
                errors.push('Subject is required');
            }
            if (!body) {
                errors.push('Message is required');
            }

            if (errors.length > 0) {
                mailStatus.textContent = errors.join('  ');
                mailStatus.className = 'mail-status error';
            } else {
                mailStatus.textContent = '';
                mailStatus.className = 'mail-status';
            }
        }

        mailFrom.addEventListener('input', validateForm);
        mailSubject.addEventListener('input', validateForm);
        mailBody.addEventListener('input', validateForm);

        // Reposition on resize
        window.addEventListener('resize', function() {
            positionMailBtn();
            positionAboutBtn();
            positionLoginBtn();
        });
    }

    if (document.readyState === 'loading') {
        document.addEventListener('DOMContentLoaded', init);
    } else {
        init();
    }
})();
    </script>
</body>
</html>
